(8, 61, 'Τοποθεσια', 'topothesia', '', '<p>Το συγκρότημα <strong>Agia Irini</strong> είναι ένα ιδανικό μέρος για να περάσετε όμορφα, μαζί με τη παρέα, την οικογένεια σας συνδυάζοντας στις διακοπές σας , χαλάρωση και μοναδικές στιγμές διασκέδασης.</p>\r\n<p>Η πρωτεύουσα του νησιού, Φηρά , απέχει μόλις 4 χλμ , ο παραδοσιακός οικισμός της Οίας 7 χλμ και το αεροδρόμιο 10 χλμ.</p>\r\n<p>Για την μετάβαση σας από το <strong>Agia Irini</strong> στο κέντρο του Ημεροβιγλίου η απόσταση είναι 2 χλμ.</p>\r\n<p>Η θέση του <strong>Agia Irini</strong> προσφέρει μοναδική θέα στο γαλάζιο του Αιγαίου , ωστόσο περιβάλλεται από αμπελώνες και αγροκτήματα και προσφέρει μια πραγματική αίσθηση ηρεμίας και φύσης.</p>\r\n<p>Η φήμη της περιοχής οφείλεται κατά κύριο λόγο στην υπέροχη ανατολή του ηλίου, την θέα στο <strong>Αιγαίο πέλαγος και στα νησιά Ίος, Ανάφη, Κουφονήσια, Αμοργός.</strong></p>\r\n<p>Κοντά στο συγκρότημά μας μπορείτε να επισκευτείτε τις ήσυχες παραλίες του νησιού μας <strong>Πορί, Κουλούμπος, Βουρβούλος, Μπαξέδες,</strong> με τα παραδοσιακά τους ταβερνάκια δίπλα στη θάλασσα.</p>', '', 1, 0, 0, 2, '2014-01-21 03:47:56', 875, '', '2014-03-26 10:29:24', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:47:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 23, 0, 14, '', '', 1, 168, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
