(10, 63, 'Δωματια για 5 ατομα', 'dwmatia-5-atoma', '', '<p><img src="images/apartment-intro.jpg" alt="" /><br /><br />Το συγκρότημα <strong>Agia Irini</strong> διαθέτει <strong>διαμερίσματα για 4 και 5 άτομα.</strong><br />\r\nΤα διαμερίσματα μας μπορούν να καλύψουν όλες τις ανάγκες μίας οικογένειας ή παρέας, για άνετη διαμονή στο συγκρότημα μας. Τα διαμερίσματα  διαθέτουν  κουζινάκι με όλα τα απαραίτητα και με βεράντες με θέα το βουνό ή τη θάλασσα.</p>\r\n', '{loadposition button}\r\n<h3>ΔΩΜΑΤΙΑ ΓΙΑ 5 ΑΤΟΜΑ</h3>\r\n<p>Τα δωμάτια είναι διακοσμημένα με παραδοσιακό νησιώτικο στυλ.<br /> Τα διαμερίσματα διαθέτουν:</p>\r\n<ul>\r\n<li>Βεράντες με θέα το βουνό ή τη θάλασσα</li>\r\n<li>Ψυγείο</li>\r\n<li>Κλιματισμός</li>\r\n<li>Τηλεόραση</li>\r\n<li>Ιδιωτικό Μπάνιο</li>\r\n<li>Σεσουάρ μαλλιών κατόπιν ζήτησης στη ρεσεψιόν</li>\r\n<li>Ασύρματη σύνδεση στο Internet</li>\r\n<li>Κουζινάκι με όλα τα απαραίτητα</li>\r\n<li>Καφετιέρα</li>\r\n<li>Βραστηρας</li>\r\n</ul>', 1, 0, 0, 21, '2014-01-21 03:49:04', 875, '', '2014-03-26 10:40:55', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"\\u0394\\u03b9\\u03b1\\u03b2\\u03ac\\u03c3\\u03c4\\u03b5 \\u03a0\\u03b5\\u03c1\\u03b9\\u03c3\\u03c3\\u03cc\\u03c4\\u03b5\\u03c1\\u03b1","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 35, 0, 3, '', '', 1, 47, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
(11, 64, 'Δωματια για 2-3 ατομα', 'dwmatia-2-3-atoma', '', '<p><img src="images/double-intro.jpg" alt="" /><br /><br />Το συγκρότημα <strong>Agia Irini</strong> διαθέτει <strong>δωμάτια για 2 και 3 άτομα.</strong><br />Όλα τα δωμάτια μας είναι σχεδιασμένα για να προσφέρουν πλούσιες ανέσεις,&nbsp; με βεράντες με θέα το βουνό ή τη θάλασσα.</p>\r\n', '{loadposition button}\r\n<h3>ΔΩΜΑΤΙΑ ΓΙΑ 2-3 ΑΤΟΜΑ</h3>\r\n<p>Τα δωμάτια είναι διακοσμημένα με παραδοσιακό νησιώτικο στυλ.<br /> Τα διαμερίσματα διαθέτουν:</p>\r\n<ul>\r\n<li>Βεράντες με θέα το βουνό ή τη θάλασσα</li>\r\n<li>Ψυγείο</li>\r\n<li>Κλιματισμός</li>\r\n<li>Τηλεόραση</li>\r\n<li>Ιδιωτικό Μπάνιο</li>\r\n<li>Σεσουάρ μαλλιών κατόπιν ζήτησης στη ρεσεψιόν</li>\r\n<li>Ασύρματη σύνδεση στο Internet</li>\r\n</ul>', 1, 0, 0, 21, '2014-01-21 03:49:22', 875, '', '2014-03-26 10:41:06', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"\\u0394\\u03b9\\u03b1\\u03b2\\u03ac\\u03c3\\u03c4\\u03b5 \\u03a0\\u03b5\\u03c1\\u03b9\\u03c3\\u03c3\\u03cc\\u03c4\\u03b5\\u03c1\\u03b1","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 29, 0, 2, '', '', 1, 81, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-