(12, 65, 'Αγια Ειρηνη', 'agia-irini-gr', '', '<p>Το παραδοσιακό, με κυκλαδίτικο στυλ, συγκρότημα <strong>Agia Irini,</strong> προσφέρεται για ονειρικές διακοπές στην μαγευτική Σαντορίνη.</p>\r\n<p>Βρίσκεται στην ανατολική πλευρά του Ημεροβιγλίου, προς παραλία Πορί και 1500 μέτρα από το χωριό Βουρβούλος.</p>\r\n<p>Σ'' ένα ειδυλλιακό περιβάλλον με παραδοσιακή αρχιτεκτονική, πλούσιες ανέσεις, δίπλα στα κύματα του βαθυγάλαζου Αιγαίου, σας καλωσορίζουμε στο συγκροτημα μας, για να σας προσφέρουμε μία αξέχαστη φιλοξενία.</p>\r\n<p><strong>Rooms Agia Irini Santorini for Rest and Relaxation</strong></p>\r\n<p>Το Παραδοσιακό συγκρότημα <strong>Agia Irini</strong> διαθέτει άνετα δωμάτια για 2 και 3 άτομα &amp; 2 διαμερίσματα που έχουν τη δυνατότητα να φιλοξενήσουν μέχρι 5 άτομα. Υπάρχει πισίνα, αίθουσα πρωινού και αίθουσα υποδοχής.</p>\r\n<p>Ακόμα και δωρεάν μεταφορικό μέσο για τη γρήγορη μετάβασή σας στο συγκρότημα <strong>Agia Irini</strong></p>', '', 1, 0, 0, 2, '2014-02-13 16:26:28', 875, '', '2014-03-26 10:33:54', 875, 0, '0000-00-00 00:00:00', '2014-02-13 16:26:28', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 27, 0, 10, '', '', 1, 380, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
(13, 66, 'Παροχες', 'paroxes', '', '<h3>ΥΠΗΡΕΣΙΕΣ ΣΥΓΚΡΟΤΗΜΑΤΟΣ</h3>\r\n<ul>\r\n<li>Μεταφορά από αεροδρόμιο / λιμάνι *</li>\r\n<li>Πισίνα και Ξαπλώστρες</li>\r\n<li>Πρωινό</li>\r\n<li>Μπαρ πισίνας</li>\r\n<li>Χώρος στάθμευσης</li>\r\n<li>Ρεσεψιόν</li>\r\n<li>Fax</li>\r\n<li>Ασύρματη σύνδεση στο Internet</li>\r\n<li>Ενοικίασεις αυτοκινήτων και μηχανών</li>\r\n<li>Καθημερινή καθαριότητα</li>\r\n<li>Μεγάλος ελεύθερος χώρος για κάθε παιδική δραστηριότητα</li>\r\n</ul>\r\n<p>*Από το αεροδρόμιο ή το λίμάνι στην άφιξη &amp; αναχώρηση. Ενημερώστε μας για την ώρα &amp; το σημείο παραλαβής (για κρατήσεις περισσοτέρων των 2 διανυκτερεύσεων)</p>', '', 1, 0, 0, 2, '2014-01-21 03:49:04', 875, '', '2014-03-18 15:22:26', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"\\u0394\\u03b9\\u03b1\\u03b2\\u03ac\\u03c3\\u03c4\\u03b5 \\u03a0\\u03b5\\u03c1\\u03b9\\u03c3\\u03c3\\u03cc\\u03c4\\u03b5\\u03c1\\u03b1","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 14, 0, 11, '', '', 1, 177, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
