(15, 68, 'Αποστασεις', 'apostaseis', '', '<p>Το συγκρότημα δωματίων <strong>Agia Irini</strong> στη Σαντορίνη απέχει από:</p>\r\n<ul>\r\n<li>Φηρά: 4 χλμ.</li>\r\n<li>Κοντινότερη ταβέρνα: 1,5 χλμ.</li>\r\n<li>Καταστήματα: 1,5 χλμ.</li>\r\n<li>Κοντινότερη παραλία: 100 μ.</li>\r\n<li>Αεροδρόμιο: 10 χλμ.</li>\r\n<li>Λιμάνι: 12 χλμ.</li>\r\n</ul>', '', 1, 0, 0, 2, '2014-02-19 15:03:41', 875, '', '2014-02-24 10:57:28', 875, 0, '0000-00-00 00:00:00', '2014-02-19 15:03:41', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 8, 0, 8, '', '', 1, 91, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
(16, 69, 'Χρησιμα links', 'xrisima-links', '', '<p>Τηλέφωνα που μπορεί να σας φανούν χρήσιμα:</p>\r\n<ul>\r\n<li>ΛΙΜΕΝΑΡΧΕΙΟ: +30 22860-22239</li>\r\n<li>ΑΕΡΟΔΡΟΜΙΟ: +30 22860-31525</li>\r\n<li>ΚΤΕΛ ΣΑΝΤΟ: +30 22860-25404</li>\r\n<li>ΡΑΔΙΟ-ΤΑΧΙ: +30 22860-22555</li>\r\n<li>ΚΕΝΤΡΟ ΥΓΕΙΑΣ: +30 22860-22237</li>\r\n<li>ΦΑΡΜΑΚΕΙΟ: +30 22860-22700</li>\r\n<li>ΕΘΝΙΚΗ ΤΡΑΠΕΖΑ: +30 22860-22662</li>\r\n<li>ΑΣΤΥΝΟΜΙΑ: +30 22860-22649</li>\r\n<li>RENT A CAR: +30 694 4142743\r\n</ul>', '', 1, 0, 0, 2, '2014-02-19 15:18:06', 875, '', '2014-02-24 10:54:36', 875, 0, '0000-00-00 00:00:00', '2014-02-19 15:18:06', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 0, 7, '', '', 1, 71, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'el-GR', ''),
(17, 70, 'Agia Irini', 'agia-irini-en', '', '<p>Traditional Cycladic-style complex of <strong>Agia Irini,</strong> is ideally for an unforgettable holiday on the beautiful island of Santorini.</p>\r\n<p>Located on the east side of Imerovigli , in Pori beach and 1500 meters from Vourvoulos village.</p>\r\n<p>In an idyllic environment with traditional architecture and luxurious comforts, next to the waves of deep blue Aegean, we welcome you to <strong>Agia Irini,</strong> to offer you an unforgettable hospitality !</p>\r\n<p>Rooms <strong>Agia Irini</strong> Santorini for Rest and Relaxation<br /><br />Tradition <strong>Agia Irini</strong> complex offers comfortable rooms for 2 and 3 persons and 2 apartments that can accomodate up to 5 people. There is a pool, breakfast room and reception hall.<br /><br />Free transportation for quick transition to and from our complex <strong>Agia Irini.</strong></p>', '', 1, 0, 0, 2, '2014-02-13 16:26:28', 875, '', '2014-03-07 16:14:12', 875, 0, '0000-00-00 00:00:00', '2014-02-13 16:26:28', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 0, 6, '', '', 1, 147, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
(18, 71, 'Location', 'location', '', '<p><strong>Agia Irini</strong> is a perfect place for family holidays.</p>\r\n<p>The island''s capital, Fira , is just 4 km away, the traditional settlement of Oia 7 km and the airport 10 km</p>\r\n<p>For your transition from <strong>Agia Irini</strong> in the center of Imerovigli distance is 2 miles</p>\r\n<p>The position of <strong>Agia Irini</strong> offers spectacular views of the blue Aegean , however , surrounded by vineyards and farms and offers a real sense of peace and nature.</p>\r\n<p>The reputation of the region is due primarily to the lovely sunrise , the views of the <strong>Aegean Sea</strong> and the islands of <strong>Ios, Anafi, Koufonissi, Amorgos.</strong></p>\r\n<p>Near <strong>Agia Irini</strong> you can visit the quiet beaches of our island <strong>Pori , Kouloumpos, Vourvouli, Emporio,</strong> with their traditional taverns by the sea .</p>', '', 1, 0, 0, 2, '2014-01-21 03:47:56', 875, '', '2014-02-24 10:57:53', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:47:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 5, '', '', 1, 24, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
(19, 72, 'Double Room', 'double-room', '', '<p><img src="images/double-intro.jpg" alt="" /><br /><br /><strong>Agia Irini</strong> complex offers <strong>rooms for 2 and 3 persons.</strong> <br />\r\nAll our rooms are designed to offer luxurious comforts, balconies with mountain or sea view.</p>\r\n', '{loadposition button}\r\n<h3>ROOMS FOR 2-3 PERSONS</h3>\r\n<p>The rooms are decorated with traditional island style.<br /> All the rooms contain:</p>\r\n<ul>\r\n<li>Balconies with mountain or sea view</li>\r\n<li>Mini fridge</li>\r\n<li>Air contitioning</li>\r\n<li>Television</li>\r\n<li>Bathroom with shower</li>\r\n<li>Hair dryer on request from reception</li>\r\n<li>Wireless Internet</li>\r\n</ul>', 1, 0, 0, 14, '2014-01-21 03:49:22', 875, '', '2014-03-26 10:43:51', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"Read More","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 14, 0, 1, '', '', 1, 22, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
(20, 73, 'Apartment', 'apartment', '', '<p><img src="images/apartment-intro.jpg" alt="" /><br /><br /><strong>Agia Irini</strong> complex offers <strong>apartments for 4 to 5 people.</strong><br /> \r\nAll our apartments can meet all the needs of a family or group, for a comfortable stay in our complex. The apartments have a small kitchen unit and balconies with mountain or sea view.</p>\r\n', '{loadposition button}\r\n<h3>APARTMENTS UP TO 5 PERSONS</h3>\r\n<p>The rooms are decorated with traditional island style.<br /> All the rooms contain:</p>\r\n<ul>\r\n<li>Balconies with mountain or sea view</li>\r\n<li>Mini fridge</li>\r\n<li>Air contitioning</li>\r\n<li>Television</li>\r\n<li>Bathroom with shower</li>\r\n<li>Hair dryer (on request from reception</li>\r\n<li>Wireless Internet Internet</li>\r\n<li>Small kitchen unit</li>\r\n<li>Coffee percolator</li>\r\n<li>Electric kettle</li>\r\n</ul>', 1, 0, 0, 14, '2014-01-21 03:49:04', 875, '', '2014-03-26 10:45:57', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"Read More","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 16, 0, 0, '', '', 1, 31, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
(21, 74, 'Services', 'services', '', '<h3>Services</h3>\r\n<ul>\r\n<li>Minibus free transfer service*</li>\r\n<li>Swimming pool &amp; sunbeds</li>\r\n<li>Breakfast room</li>\r\n<li>Pool Bar</li>\r\n<li>Parking</li>\r\n<li>Reception area</li>\r\n<li>Fax</li>\r\n<li>Wireless Internet</li>\r\n<li>Car rental</li>\r\n<li>Daily cleaning</li>\r\n<li>A large clear space for child activities</li>\r\n</ul>\r\n<p>* From or to airport and port on arrival or departure. Inform us for the time and place to meet.</p>', '', 1, 0, 0, 2, '2014-01-21 03:49:04', 875, '', '2014-03-18 15:22:42', 875, 0, '0000-00-00 00:00:00', '2014-01-21 03:49:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"\\u0394\\u03b9\\u03b1\\u03b2\\u03ac\\u03c3\\u03c4\\u03b5 \\u03a0\\u03b5\\u03c1\\u03b9\\u03c3\\u03c3\\u03cc\\u03c4\\u03b5\\u03c1\\u03b1","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 8, 0, 4, '', '', 1, 23, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
(22, 75, 'Distances', 'distances', '', '<p><strong>Agia Irini</strong> complex in Santorini is from:</p>\r\n<ul>\r\n<li>Fira: 4 km.</li>\r\n<li>Nearest tavern: 1,5 km.</li>\r\n<li>Shops: 1,5 km.</li>\r\n<li>Nearest beach: 100 m.</li>\r\n<li>Airport: 10 km.</li>\r\n<li>Port: 12 km.</li>\r\n</ul>', '', 1, 0, 0, 2, '2014-02-19 15:03:41', 875, '', '2014-03-17 02:31:56', 875, 0, '0000-00-00 00:00:00', '2014-02-19 15:03:41', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, 3, '', '', 1, 27, '{"robots":"","author":"","rights":"","xreference":""}', 0, 'en-GB', ''),
